import React, {Dispatch, SetStateAction} from "react";
import Logo from '../assets/images/top_logo.png';
import BaseButtons from "./commons/baseButtos";
import HeadButton from "./headButton";
import cn from "classnames";

interface Props {
    type?: string;
    setType : React.Dispatch<SetStateAction<string>>,
}
export default function Header({type, setType} : Props) {

    return (
        <div className='header border rounded-xl'>
            <div className='head_div pt-2'>
                <img src={Logo} alt={'Logo'} width={200}/>
            </div>
            <div className='head_div flex items-center'>
                <div className='head_button_group'>
                    <HeadButton type={'01'} text={'마이체크업'} setType={setType} className={cn('header_button',{'head_check' : type ==='01'})} />
                    <HeadButton type={'02'} text={'벨류맵'} setType={setType} className={cn('header_button',{'head_check' : type ==='02'})}/>
                </div>
            </div>
            <div className='head_div pt-2 flex items-center text-white'>
                <p>{type === '01' ? "마이체크업" : "벨류맵"}</p>
            </div>
        </div>
    )
}
